import logo from './logo.svg';
import './App.css';
import React from "react";
import {
  BrowserRouter as Router,
  Routes,
  Route,
  Link
} from "react-router-dom";
import Customers from "./pages/Customers.js";

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/customers">
          <Customers />
        </Route>
      </Routes>
    </Router>
  );
}

export default App;
